import React, { Component } from 'react'
import './about.scss';

class About extends Component {
    render() {
        return (
            <div className="about">
                <h2>The purpose</h2>
                <p>During this pandemic, more and more people become secluded, we hope with this app you can find and have a long lasting friendship</p>
            </div>
        )
    }
}

export default About
